create table sku
(
    id       int auto_increment primary key,
    name     varchar(40) null,
    sku_type varchar(40) null
);

create table user
(
    id       int auto_increment primary key,
    name     varchar(40)  null,
    username varchar(40)  null,
    password varchar(300) null,
    active   tinyint      null,
    admin    tinyint      null,
    constraint user_username_uindex unique (username)
);

create table export_history
(
    id          int auto_increment primary key,
    start_date  date         not null,
    end_date    date         not null,
    file_url    text         null,
    file_name   varchar(100) null,
    type        varchar(40)  null,
    exported_by int          null,
    constraint export_history_id_uindex
        unique (id),
    constraint export_history_user
        foreign key (exported_by) references user (id)
);


create table `orders`
(
    id                    int auto_increment primary key,
    order_no              varchar(40)   null,
    quantity              int           null,
    product_name          text          null,
    product_title         text          null,
    bulb_type             varchar(40)   null,
    bulb_type_fog_light   varchar(40)   null,
    high_beam             varchar(40)   null,
    low_beam              varchar(40)   null,
    fog_light             varchar(40)   null,
    hb_can_bus            varchar(40)   null,
    lb_can_bus            varchar(40)   null,
    vehicle_year          int           null,
    order_notes           varchar(200)  null,
    additional_details    text          null,
    shipping_name         varchar(60)   null,
    shipping_address1     varchar(200)  null,
    address2              varchar(200)  null,
    shipping_city         varchar(60)   null,
    shipping_zip          varchar(60)   null,
    shipping_province     varchar(60)   null,
    shipping_country_code varchar(60)   null,
    shipping_country      varchar(60)   null,
    shipping_phone        varchar(60)   null,
    shipping_company      varchar(60)   null,
    order_date            datetime      null,
    last_modification     datetime      null,
    modified_by           int           null,
    item_line_id          bigint        null,
    shopify_id            bigint        null,
    order_status          int default 1 not null,
    export_file           int           null,
    vehicle_make          varchar(60)   null,
    vehicle_model         varchar(60)   null,
    constraint order_export
        foreign key (export_file) references export_history (id)
            on delete set null,
    constraint order_user
        foreign key (modified_by) references user (id)
);

create table vehicle
(
    id            int auto_increment primary key,
    year          int          null,
    make          varchar(100) null,
    model         varchar(100) null,
    high_low_beam varchar(100) null,
    high_beam     varchar(100) null,
    low_beam      varchar(100) null,
    fog_light     varchar(100) null
);

